import React from 'react';
import ReactDom from 'react-dom';

const App = () =>{
    return(
        <div className="container">

        <form>

        <h2>Create Your Account</h2>

        <p><input required placeholder="Registration Number"type=""></input></p>
        <p><input required placeholder="Chasis Number" type=""></input></p>
        <p><input required placeholder="Username"></input></p>
        <p><label> <img src=""  />
        <input  required placeholder="Email" type="Email"></input>
        </label></p>
        <p><input required placeholder="Password" type="Password"></input></p>
        <p><input required placeholder="Confirm Password" type="Password"></input></p>

        <input type="Submit" value="Create Account"></input>
        
        </form>
        
        
        
        </div>
    );
};











ReactDom.render(<App />,document.querySelector('#root'));
